configure:
  commands:
    end:
      new_state: execute
    ip access-list extended test1: "ip access-list extended test1\r\n"
    line console 0:
      new_state: configure_line
    no logging console: ''
    " permit igmp any any reflect R2  ": " permit igmp any any reflect R2  \r\n"
  prompt: Cat9600-SVL_CGW(config)#
configure_line:
  commands:
    end:
      new_state: execute
    exec-timeout 0: ''
  prompt: Cat9600-SVL_CGW(config-line)#
connect:
  commands:
    ? ''
    : new_state: execute
  preface: 'Trying mock_device ...

    Connected to mock_device.

    Escape character is ''^]''.'
  prompt: ''
execute:
  commands:
    config term:
      new_state: configure
    config-transaction:
      new_state: configure
    show version: ''
    term length 0: ''
    term width 0: ''
  prompt: Cat9600-SVL_CGW#
